import axios from 'axios';

export default async function callTickets() {
    return await axios.get(`${process.env.REACT_APP_DEV_URL}ld-tickets`)
        .then(() => {
            return new Promise((res, rej) => {
                res(e => console.log(e))
            })
        })
}
